РџРµСЂРІРёС‡РЅР°СЏ РїСЂРѕС„СЃРѕСЋР·РЅР°СЏ РѕСЂРіР°РЅРёР·Р°С†РёСЏ

СѓС‡СЂРµР¶РґРµРЅРёСЏ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ В«РњРёРЅСЃРєРёР№ РіРѕСЃСѓРґР°СЂСЃС‚РІРµРЅРЅС‹Р№ РєРѕР»Р»РµРґР¶ Р°РІС‚РѕРјРѕР±РёР»РµСЃС‚СЂРѕРµРЅРёСЏВ»

Р‘РµР»РѕСЂСѓСЃСЃРєРѕРіРѕ РїСЂРѕС„РµСЃСЃРёРѕРЅР°Р»СЊРЅРѕРіРѕ СЃРѕСЋР·Р° СЂР°Р±РѕС‚РЅРёРєРѕРІ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ Рё РЅР°СѓРєРё

РџРµСЂРІРёС‡РЅР°СЏ РїСЂРѕС„СЃРѕСЋР·РЅР°СЏ РѕСЂРіР°РЅРёР·Р°С†РёСЏ СѓС‡СЂРµР¶РґРµРЅРёСЏ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ В«РњРёРЅСЃРєРёР№ РіРѕСЃСѓРґР°СЂСЃС‚РІРµРЅРЅС‹Р№ РєРѕР»Р»РµРґР¶ Р°РІС‚РѕРјРѕР±РёР»РµСЃС‚СЂРѕРµРЅРёСЏВ» Р‘РµР»РѕСЂСѓСЃСЃРєРѕРіРѕ РїСЂРѕС„РµСЃСЃРёРѕРЅР°Р»СЊРЅРѕРіРѕ СЃРѕСЋР·Р° СЂР°Р±РѕС‚РЅРёРєРѕРІ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ Рё РЅР°СѓРєРё вЂ“ СЌС‚Рѕ 696 С‡Р»РµРЅРѕРІ РїСЂРѕС„СЃРѕСЋР·Р°. РћС…РІР°С‚ РїСЂРѕС„СЃРѕСЋР·РЅС‹Рј С‡Р»РµРЅСЃС‚РІРѕРј СЃРѕСЃС‚Р°РІР»СЏРµС‚ 96,5 %.

РџСЂРёРѕСЂРёС‚РµС‚РЅС‹Рµ РЅР°РїСЂР°РІР»РµРЅРёСЏ СЂР°Р±РѕС‚С‹ РїРµСЂРІРёС‡РЅРѕР№ РїСЂРѕС„СЃРѕСЋР·РЅРѕР№ РѕСЂРіР°РЅРёР·Р°С†РёРё СѓС‡СЂРµР¶РґРµРЅРёСЏ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ В«РњРёРЅСЃРєРёР№ РіРѕСЃСѓРґР°СЂСЃС‚РІРµРЅРЅС‹Р№ РєРѕР»Р»РµРґР¶ Р°РІС‚РѕРјРѕР±РёР»РµСЃС‚СЂРѕРµРЅРёСЏВ» Р‘РµР»РѕСЂСѓСЃСЃРєРѕРіРѕ РїСЂРѕС„СЃРѕСЋР·Р° СЂР°Р±РѕС‚РЅРёРєРѕРІ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ Рё РЅР°СѓРєРё СЌС‚Рѕ:

    Р—Р°С‰РёС‚Р° С‚СЂСѓРґРѕРІС‹С… РїСЂР°РІ Рё СЃРѕС†РёР°Р»СЊРЅРѕ-СЌРєРѕРЅРѕРјРёС‡РµСЃРєРёС… РёРЅС‚РµСЂРµСЃРѕРІ С‚СЂСѓРґСЏС‰РёС…СЃСЏ.
    РћС…СЂР°РЅР° С‚СЂСѓРґР° Рё Р·РґРѕСЂРѕРІСЊСЏ, РѕР±РµСЃРїРµС‡РµРЅРёРµ Р±РµР·РѕРїР°СЃРЅС‹С… СѓСЃР»РѕРІРёР№ С‚СЂСѓРґР°.
    Р Р°Р·РІРёС‚РёРµ Рё СѓРєСЂРµРїР»РµРЅРёРµ СЃРѕС†РёР°Р»СЊРЅРѕРіРѕ РїР°СЂС‚РЅРµСЂСЃС‚РІР°.
    РћРєР°Р·Р°РЅРёРµ РјР°С‚РµСЂРёР°Р»СЊРЅРѕР№ РїРѕРјРѕС‰Рё.
    РћСЂРіР°РЅРёР·Р°С†РёСЏ РґРѕСЃСѓРіР°.
    Р¤РѕСЂРјРёСЂРѕРІР°РЅРёРµ Р·РґРѕСЂРѕРІРѕРіРѕ РѕР±СЂР°Р·Р° Р¶РёР·РЅРё.

Р¦РµР»СЏРјРё РїРµСЂРІРёС‡РЅРѕР№ РїСЂРѕС„СЃРѕСЋР·РЅРѕР№ РѕСЂРіР°РЅРёР·Р°С†РёРё СѓС‡СЂРµР¶РґРµРЅРёСЏ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ В«РњРёРЅСЃРєРёР№ РіРѕСЃСѓРґР°СЂСЃС‚РІРµРЅРЅС‹Р№ РєРѕР»Р»РµРґР¶ Р°РІС‚РѕРјРѕР±РёР»РµСЃС‚СЂРѕРµРЅРёСЏВ» Р‘РµР»РѕСЂСѓСЃСЃРєРѕРіРѕ РїСЂРѕС„РµСЃСЃРёРѕРЅР°Р»СЊРЅРѕРіРѕ СЃРѕСЋР·Р° СЂР°Р±РѕС‚РЅРёРєРѕРІ РѕР±СЂР°Р·РѕРІР°РЅРёСЏ Рё РЅР°СѓРєРё СЏРІР»СЏСЋС‚СЃСЏ:

    СЂРµР°Р»РёР·Р°С†РёСЏ СѓСЃС‚Р°РІРЅС‹С… Р·Р°РґР°С‡ РџСЂРѕС„СЃРѕСЋР·Р° РїРѕ РїСЂРµРґСЃС‚Р°РІРёС‚РµР»СЊСЃС‚РІСѓ Рё Р·Р°С‰РёС‚Рµ СЃРѕС†РёР°Р»СЊРЅРѕ-С‚СЂСѓРґРѕРІС‹С… РїСЂР°РІ Рё РїСЂРѕС„РµСЃСЃРёРѕРЅР°Р»СЊРЅС‹С… РёРЅС‚РµСЂРµСЃРѕРІ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°;
    РѕР±С‰РµСЃС‚РІРµРЅРЅС‹Р№ РєРѕРЅС‚СЂРѕР»СЊ Р·Р° СЃРѕР±Р»СЋРґРµРЅРёРµРј Р·Р°РєРѕРЅРѕРґР°С‚РµР»СЊСЃС‚РІР° Рѕ С‚СЂСѓРґРµ Рё РѕС…СЂР°РЅРµ С‚СЂСѓРґР°;
    СѓР»СѓС‡С€РµРЅРёРµ РјР°С‚РµСЂРёР°Р»СЊРЅРѕРіРѕ РїРѕР»РѕР¶РµРЅРёСЏ, СѓРєСЂРµРїР»РµРЅРёСЏ Р·РґРѕСЂРѕРІСЊСЏ Рё РїРѕРІС‹С€РµРЅРёСЏ Р¶РёР·РЅРµРЅРЅРѕРіРѕ СѓСЂРѕРІРЅСЏ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°;
    РёРЅС„РѕСЂРјР°С†РёРѕРЅРЅРѕРµ РѕР±РµСЃРїРµС‡РµРЅРёРµ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°, СЂР°Р·СЉСЏСЃРЅРµРЅРёРµ РјРµСЂ, РїСЂРёРЅРёРјР°РµРјС‹С… РџСЂРѕС„СЃРѕСЋР·РѕРј РїРѕ СЂРµР°Р»РёР·Р°С†РёРё СѓСЃС‚Р°РІРЅС‹С… С†РµР»РµР№ Рё Р·Р°РґР°С‡;
    РѕСЂРіР°РЅРёР·Р°С†РёСЏ РїСЂРёС‘РјР° РІ РџСЂРѕС„СЃРѕСЋР· Рё СѓС‡С‘С‚ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°, РѕСЃСѓС‰РµСЃС‚РІР»РµРЅРёРµ РѕСЂРіР°РЅРёР·Р°С†РёРѕРЅРЅС‹С… РјРµСЂРѕРїСЂРёСЏС‚РёР№ РїРѕ РїРѕРІС‹С€РµРЅРёСЋ РјРѕС‚РёРІР°С†РёРё РїСЂРѕС„СЃРѕСЋР·РЅРѕРіРѕ С‡Р»РµРЅСЃС‚РІР°;
    СЃРѕР·РґР°РЅРёРµ СѓСЃР»РѕРІРёР№, РѕР±РµСЃРїРµС‡РёРІР°СЋС‰РёС… РІРѕРІР»РµС‡РµРЅРёРµ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р° РІ РїСЂРѕС„СЃРѕСЋР·РЅСѓСЋ СЂР°Р±РѕС‚Сѓ.

Р”Р»СЏ РґРѕСЃС‚РёР¶РµРЅРёСЏ СѓСЃС‚Р°РІРЅС‹С… С†РµР»РµР№ РїСЂРѕС„СЃРѕСЋР·РЅР°СЏ РѕСЂРіР°РЅРёР·Р°С†РёСЏ:

    РІРµРґС‘С‚ РїРµСЂРµРіРѕРІРѕСЂС‹ СЃ Р°РґРјРёРЅРёСЃС‚СЂР°С†РёРµР№ РєРѕР»Р»РµРґР¶Р°;
    Р·Р°РєР»СЋС‡Р°РµС‚ РѕС‚ РёРјРµРЅРё С‡Р»РµРЅРѕРІ РїСЂРѕС„СЃРѕСЋР·Р° РєРѕР»Р»РµРєС‚РёРІРЅС‹Р№ РґРѕРіРѕРІРѕСЂ СЃ Р°РґРјРёРЅРёСЃС‚СЂР°С†РёРµР№ Рё СЃРїРѕСЃРѕР±СЃС‚РІСѓРµС‚ РµРіРѕ СЂРµР°Р»РёР·Р°С†РёРё;
    РѕРєР°Р·С‹РІР°РµС‚ СЋСЂРёРґРёС‡РµСЃРєСѓСЋ, РјР°С‚РµСЂРёР°Р»СЊРЅСѓСЋ РїРѕРјРѕС‰СЊ С‡Р»РµРЅР°Рј РїСЂРѕС„СЃРѕСЋР·Р°;
    РѕСЃСѓС‰РµСЃС‚РІР»СЏРµС‚ РѕР±С‰РµСЃС‚РІРµРЅРЅС‹Р№ РєРѕРЅС‚СЂРѕР»СЊ Р·Р° СЃРѕР±Р»СЋРґРµРЅРёРµРј С‚СЂСѓРґРѕРІРѕРіРѕ Р·Р°РєРѕРЅРѕРґР°С‚РµР»СЊСЃС‚РІР°, РїСЂР°РІРёР» Рё РЅРѕСЂРј РѕС…СЂР°РЅС‹ С‚СЂСѓРґР° РІ РѕС‚РЅРѕС€РµРЅРёРё С‡Р»РµРЅРѕРІ РїСЂРѕС„СЃРѕСЋР·Р°;
    РїСЂРµРґСЃС‚Р°РІР»СЏРµС‚ РёРЅС‚РµСЂРµСЃС‹ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р° (РїРѕ РёС… РїРѕСЂСѓС‡РµРЅРёСЋ) РїСЂРё СЂР°СЃСЃРјРѕС‚СЂРµРЅРёРё РёРЅРґРёРІРёРґСѓР°Р»СЊРЅС‹С… С‚СЂСѓРґРѕРІС‹С… СЃРїРѕСЂРѕРІ;
    СѓС‡Р°СЃС‚РІСѓРµС‚ РІ СѓСЂРµРіСѓР»РёСЂРѕРІР°РЅРёРё РєРѕР»Р»РµРєС‚РёРІРЅС‹С… С‚СЂСѓРґРѕРІС‹С… СЃРїРѕСЂРѕРІ (РєРѕРЅС„Р»РёРєС‚РѕРІ) РІ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ РґРµР№СЃС‚РІСѓСЋС‰РёРј Р·Р°РєРѕРЅРѕРґР°С‚РµР»СЊСЃС‚РІРѕРј Р Р‘;
    РїРѕ РїРѕСЂСѓС‡РµРЅРёСЋ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°, Р° С‚Р°РєР¶Рµ РїРѕ СЃРѕР±СЃС‚РІРµРЅРЅРѕР№ РёРЅРёС†РёР°С‚РёРІРµ, РѕР±СЂР°С‰Р°РµС‚СЃСЏ СЃ Р·Р°СЏРІР»РµРЅРёРµРј РІ Р·Р°С‰РёС‚Сѓ РёС… С‚СЂСѓРґРѕРІС‹С… РїСЂР°РІ РІ РѕСЂРіР°РЅС‹, СЂР°СЃСЃРјР°С‚СЂРёРІР°СЋС‰РёРµ С‚СЂСѓРґРѕРІС‹Рµ СЃРїРѕСЂС‹;
    СѓС‡Р°СЃС‚РІСѓРµС‚ РІ РёР·Р±РёСЂР°С‚РµР»СЊРЅС‹С… РєРѕРјРїР°РЅРёСЏС… РІ СЃРѕРѕС‚РІРµС‚СЃС‚РІРёРё СЃ С„РµРґРµСЂР°Р»СЊРЅС‹Рј Рё РјРµСЃС‚РЅС‹Рј Р·Р°РєРѕРЅРѕРґР°С‚РµР»СЊСЃС‚РІРѕРј Рѕ РІС‹Р±РѕСЂР°С…;
    РґРѕРІРѕРґРёС‚ РґРѕ СЃРІРµРґРµРЅРёСЏ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р° СЂРµС€РµРЅРёСЏ РІС‹Р±РѕСЂРЅС‹С… РѕСЂРіР°РЅРѕРІ, РІС‹С€РµСЃС‚РѕСЏС‰РёС… РѕСЂРіР°РЅРёР·Р°С†РёР№ РџСЂРѕС„СЃРѕСЋР·Р°;
    СЃРѕРґРµР№СЃС‚РІСѓРµС‚ РѕС…СЂР°РЅРµ Р·РґРѕСЂРѕРІСЊСЏ, СЃРѕР·РґР°РЅРёСЋ Р·РґРѕСЂРѕРІС‹С… Рё Р±РµР·РѕРїР°СЃРЅС‹С… СѓСЃР»РѕРІРёР№ С‚СЂСѓРґР°, РѕР±СѓС‡РµРЅРёСЋ С‡Р»РµРЅРѕРІ РџСЂРѕС„СЃРѕСЋР·Р°;
Р’ С†РµРЅС‚СЂРµ РІРЅРёРјР°РЅРёСЏ РѕСЂРіР°РЅРёР·Р°С†РёРё РїСЂРѕС„СЃРѕСЋР·Р° Р±С‹Р» Рё РѕСЃС‚Р°РµС‚СЃСЏ С‡РµР»РѕРІРµРє, РїРµРґР°РіРѕРі РёРЅС‚РµР»Р»РµРєС‚СѓР°Р»СЊРЅРѕРіРѕ С‚СЂСѓРґР°, РІРѕСЃРїРёС‚Р°С‚РµР»СЊ Рё РІРґРѕС…РЅРѕРІРёС‚РµР»СЊ РјРѕР»РѕРґРѕРіРѕ РїРѕРєРѕР»РµРЅРёСЏ, РїСЂРµРґСЃС‚Р°РІРёС‚РµР»Рё РєРѕС‚РѕСЂРѕРіРѕ СЃС‚Р°РЅСѓС‚ Р·Р°РІС‚СЂР° СЂСѓРєРѕРІРѕРґРёС‚РµР»СЏРјРё, РґРµРїСѓС‚Р°С‚Р°РјРё, СЃРїРµС†РёР°Р»РёСЃС‚Р°РјРё СЂР°Р·Р»РёС‡РЅС‹С… РѕС‚СЂР°СЃР»РµР№ РґРµСЏС‚РµР»СЊРЅРѕСЃС‚Рё.

